import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { Auth0Provider } from '@auth0/auth0-react'


ReactDOM.render(
  <Auth0Provider
    domain="dispatch-development.auth0.com"
    // clientId='LpTdMlsPj0XxYRs3BxddLwzcXSNkL7TB'
    clientId='hhfmjSRmta9LHppSLAZ2183sBrNevRSA'
    redirectUri={window.location.origin}
    audience="care-manager.dispatchhealth.com">

    <App />

  </Auth0Provider>,
  document.getElementById('root')
);
